begin;
DROP TABLE IF EXISTS `identity`;

CREATE TABLE `identity` (
                            `id` varchar(36) NOT NULL,
                            `name_id` varchar(255) NOT NULL,
                            `institution` varchar(255) NOT NULL,
                            `email` varchar(255) NOT NULL,
                            `common_name` varchar(255) NOT NULL,
                            `preferred_locale` varchar(255) NOT NULL
);


DROP TABLE IF EXISTS `configured_institution`;
CREATE TABLE `configured_institution` (
    `institution` varchar(255) NOT NULL
);


DROP TABLE IF EXISTS `institution_authorization`;
CREATE TABLE `institution_authorization` (
                                             `institution` varchar(255) NOT NULL,
                                             `institution_relation` varchar(255) NOT NULL,
                                             `institution_role` varchar(10) NOT NULL
);


DROP TABLE IF EXISTS `ra_listing`;
CREATE TABLE `ra_listing` (
                              `id` integer NOT NULL primary key autoincrement,
                              `identity_id` varchar(36) NOT NULL,
                              `institution` varchar(255) NOT NULL,
                              `common_name` varchar(255) NOT NULL,
                              `email` varchar(255) NOT NULL,
                              `role` varchar(20) NOT NULL,
                              `location` longtext DEFAULT NULL,
                              `contact_information` longtext DEFAULT NULL,
                              `ra_institution` varchar(255) NOT NULL
);

commit;
